q($,"aWk","Z2",function(){var p=null,o=t.t
return P.T(["intro","Sou um futuro cientista da computa\xe7\xe3o que al\xe9m de apaixonado por desenvolver solu\xe7\xf5es que resolvem problemas especialmente para plataformas m\xf3veis, tenho uma ambi\xe7\xe3o especial em construir aplica\xe7\xf5es com visual de alto n\xedvel, perfeitamente alinhados em cada pixel de modo a entregar uma experi\xeancia fluida tanto no UX Front-End como no desempenho do Back-End. Aprender coisas novas definitivamente \xe9 algo que eu amo, ent\xe3o, creio que a melhor forma de potencializar isso \xe9 me integrando num ambiente que me exponha a desafios, pois sou convicto de que eles possibilitam n\xe3o s\xf3 o desenvolvimento profissional e intelectual, mas principalmente exp\xf5em a situa\xe7\xf5es que agu\xe7am o senso de humanidade.","experiences",H.b([M.yZ(520,'<p style="text-align=right">Atuo como volunt\xe1rio ao Instituto dos Engenheiros El\xe9tricos e Eletr\xf4nicos (<strong>IEEE</strong>).   Inicialmente eu era integrante da divis\xe3o de cursos e membresias, e ajudava a produzir os editais de cursos e workshops organizados pelos alunos com o objetivo final de atrair mais estudantes. o IEEE \xe9 uma institui\xe7\xe3o mundial <strong>sem fins lucrativos</strong> que visa promover a integra\xe7\xe3o entre os cursos atrav\xe9s de <strong>projetos</strong> que estimulam a <strong>aprendizagem</strong> e fus\xe3o dos conhecimentos entre o pessoal dos cursos de Computa\xe7\xe3o, f\xedsica, automa\xe7\xe3o industrial e do ensino m\xe9dio integrado, sempre tendo como alvo final o <strong>benef\xedcio \xe0 comunidade</strong> que cerca o campus.</p>\n<div dir="RTL">\n<ul>\n<strong>:Alguns projetos desenvolvidos</strong>\n<br>\n            <li>Lab Kids(Ramo do IFB)</li>\n            <li>Cofre inteligente</li>\n            <li>Impressora 3d com sucata</li>\n            <li>Ponto de entrega volunt\xe1ria (PEV)</li>\n            <li>Mosqueteiras (visa incentivar a perman\xeancia e a entrada de meninas nos cursos de exatas)</li>\n            <li>RePlante (visa devolver pra natureza, os recursos gastos em nossas* atividades)</li>\n\n</ul>\n</div>\n',H.b([L.cw(C.mi,p,p)],o),"IEEE (05/2018 - agora)"),M.yZ(350,'        <p style="text-align=right"> Atuei como estagi\xe1rio na Nova <strong>T\xe9cnica Virtual</strong>.  Uma empresa da regi\xe3o  de Bras\xedlia que possui um e-commerce voltado para o mercado de materiais el\xe9tricos. L\xe1 eu era respons\xe1vel por gerenciar todo o sistema de e-commerce, garantindo que as informa\xe7\xf5es sempre estivessem atualizadas, buscando maneiras de aumentar a efici\xeancia dos processos internos com a plataforma da loja integrada entre outras atividades.</p>\n        ',H.b([L.cw(C.mi,p,p)],o),"NT Virtual (01/2019 - 06/2019)"),M.yZ(520,'        <p style="text-align=right">Me associei ao Cap\xedtulo de Computa\xe7\xe3o (Computer Chapter), onde atuo na divis\xe3o de projetos geralmente como desenvolvedor/designer. Atualmente temos dois projetos:</p>\n\n<p style="text-align=right"><strong>Planty</strong> - Um aplicativo idealizado em parceria os alunos do curso de <strong>automa\xe7\xe3o industrial</strong>, que visa <strong>incentivar</strong> a comunidade a cuidar da \xe1rea verde de Bras\xedlia em troca de recompensas (estamos desenvolvendo um <strong>dispositivo</strong> especial onde pode ser armazenada <strong>\xe1gua</strong>, e o mesmo mede o volume restante compartilhando esse dado com o app. o projeto ainda est\xe1 em fase de <strong>estudo</strong>, e estamos buscando <strong>parcerias</strong>)</p>\n\n<p style="text-align=right"><strong>LiveBus</strong> - Este projeto visa implantar um aplicativo eficiente e com um <strong>design amig\xe1vel</strong> que cumpra o desafio de rastrear <strong>em tempo real</strong> o <strong>transporte p\xfablico</strong> do Distrito Federal. Com alguns alunos envolvidos, temos tamb\xe9m o apoio do Akira Toyama (Engenheiro da Caixa Econ\xf4mica Federal, e presidente do IEEE Centro - Norte). Optamos por  desenvolver esse app usando <strong>Flutter</strong>, e eu estive respons\xe1vel por <strong>treinar</strong> a equipe de desenvolvimento durante a pandemia at\xe9 termos condi\xe7\xf5es de iniciar o projeto.</p>\n\n<p style="text-align=right">Tamb\xe9m contribuo periodicamente com  divis\xe3o de marketing. </p>\n        ',H.b([L.cw(C.xC,p,p),L.cw(C.xH,p,p),L.cw(C.xB,p,p)],o),"Projetos IEEE (01/2019 - agora)"),M.yZ(350,'<p style="text-align=right"> Atuo na CASSI como estagi\xe1rio na <strong>divis\xe3o de relacionamento com participantes (DRP)</strong>, onde basicamente sou respons\xe1vel por:</p>\n<div dir="RTL">\n<ul>\n<li>*Criar  ferramentas de consulta, ger\xeancia e an\xe1lise para a divis\xe3o de relacionamento com participantes utilizando Excel e Access;</li>\n<li>*Respons\xe1vel por organizar e tratar todas as devolu\xe7\xf5es de cart\xf5es, reenviando os mesmos, quando poss\xedvel, ou destruindo-os, caso inativos;</li>\n<li>*Mediar algumas tarefas entre os funcion\xe1rios do DRP e as demais divis\xf5es da empresa.</li>\n</ul>\n</div>\n',H.b([L.cw(C.xD,p,p)],o),"CASSI (07/2019 - 12/2020)"),M.yZ(550,"<p>No Brasa Hacks (Organizado pela <strong>Shawee</strong>), idealizei junto a alguns amigos o que chamamos de  <strong>NuGasto!</strong>, que se trata de uma feature para auxiliar os clientes do <strong>Nubank</strong> a organizarem suas finan\xe7as. A feature <strong>agrupa</strong> todos os gastos e ganhos do usu\xe1rio (aqueles lan\xe7ados pelo cart\xe3o de cr\xe9dito e tamb\xe9m aqueles da fun\xe7\xe3o d\xe9bito) e traz <strong>an\xe1lises</strong> das transa\xe7\xf5es em quest\xe3o. Ela permite que o usu\xe1rio defina <strong>metas financeiras</strong> que podem ser acompanhadas atrav\xe9s de an\xe1lises autom\xe1ticas da feature. Um dos principais objetivos do NuGasto! \xe9 auxiliar o usu\xe1rio a visualizar e analisar todos os seus gastos e ganhos em um lugar s\xf3. Por isso, criamos uma fun\xe7\xe3o onde ele pode <strong>escanear o QR Code</strong> de notas fiscais para lan\xe7\xe1-las automaticamente como uma despesa no banco de dados do Nubank. Al\xe9m disso, o usu\xe1rio teria acesso ao conte\xfado do blog do Nubank diretamente no app, por onde ele ganharia pontos seja realizando <strong>testes din\xe2micos</strong> ou ao atingir metas de controle financeiro. Toda a feature foi pensada para ser baseada nas atividades do usu\xe1rio, e tamb\xe9m gerenciada ao m\xe1ximo por ele, que por sinal teria o <strong>poder</strong> de lan\xe7ar e editar os seus gastos podendo tamb\xe9m definir as suas pr\xf3prias <strong>metas de controle financeiro</strong>. A nossa miss\xe3o era oferecer uma experi\xeancia personaliz\xe1vel, e ao mesmo tempo   automatizada, tornando a tomada de decis\xf5es mais embasada atrav\xe9s de dados essenciais  para o controle financeiro.</p>",H.b([L.cw(C.xG,p,p),L.cw(C.xF,p,p),L.cw(C.xE,p,p)],o),"Brasa Hacks (02/2020)"),M.yZ(600,'<p>Ajudei a idealizar o <strong>SafeBot</strong>, um projeto no Hacka Gr1D Pocket  - tamb\xe9m organizado pela Shawee. Ele se trata de um recurso que auxilia as seguradoras no processo de moderniza\xe7\xe3o do fluxo de trabalho dos seus corretores. A ideia era oferecer uma solu\xe7\xe3o <strong>desburocratizada</strong>, segura e disruptiva focada em tornar o trabalho do corretor mais c\xf4modo. Informa\xe7\xf5es  pessoais de clientes sempre s\xe3o necess\xe1rias e por se tratarem dados sens\xedveis (ainda mais em tempos de LGPD), quase sempre h\xe1 um processo penoso e/ou burocr\xe1tico a cumprir para acess\xe1-las. Nesse projeto, n\xf3s defendemos que para uma solu\xe7\xe3o ser <strong>segura</strong> e tratar os dados pessoais dentro dos limites legais, ela <strong>n\xe3o precisa oferecer uma experi\xeancia  burocr\xe1tica</strong>.\nA proposta do SafeBot \xe9 ser um local <strong>seguro</strong> onde o corretor possa obter dados inerentes a suas rela\xe7\xf5es com os clientes, tais como:</p>\n<div dir="RTL">\n<ul>\n<li>Sua carteira de clientes</li>\n<li>Ver informa\xe7\xf5es como o hist\xf3rico de sinistros acionados por um cliente espec\xedfico\nE consultar dados comuns a todos os clientes (como data de nascimento, CPF etc)</li>\n<li>Consultar o status de algumas documenta\xe7\xf5es espec\xedficas inerentes aos corretores</li>\n<ul>\n</div>\n\n<p>Link com mais detalhes do projeto: <a>bit.ly/3bp0d9l</a></p>',H.b([L.cw(C.xJ,p,p)],o),"Hacka GR1D Pocket (03/2020)")],H.a0("o<tc*>")),"certifications",H.b([new N.xL("https://images.ctfassets.net/q33z48p65a6w/1ciJXQwQjfgRWGcpyI1Oqp/21259688e6e67a17b93383bfa0e9bd0f/4._Partner_Icons_-_Udemy.png","Curso de Dartlang completo do b\xe1sico ao avan\xe7ado (Completo de verdade)","Acessar credencial")],H.a0("o<xL*>")),"skills",H.b([new B.Cs("Java","https://upload.wikimedia.org/wikipedia/commons/thumb/5/5d/Duke_%28Java_mascot%29_waving.svg/568px-Duke_%28Java_mascot%29_waving.svg.png")],H.a0("o<Cs*>"))],t.X,t.ub)})
